class Solution {
    public long minSum(int[] nums1, int[] nums2) {
        long sum1 = 0, sum2 = 0;
        int zeroCount1 = 0, zeroCount2 = 0;
        for (int num : nums1) {
            if (num == 0) zeroCount1++;
            sum1 += num;
        }
        for (int num : nums2) {
            if (num == 0) zeroCount2++;
            sum2 += num;
        }
        if (zeroCount1 == 0 && zeroCount2 == 0) {
            return sum1 == sum2 ? sum1 : -1;
        }
        long diff = Math.abs(sum1 - sum2);
        if ((zeroCount1 + zeroCount2) == 1) {
            return Math.max(sum1, sum2) + 1;
        }
        if (diff % (zeroCount1 + zeroCount2) == 0) {
            return Math.max(sum1, sum2) + diff / (zeroCount1 + zeroCount2);
        } else {
            return -1;
        }
    }
}
